import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const Register = () => {
  const [formData, setFormData] = useState({
    username: '',
    email: '',
    password: ''
  });
  const [error, setError] = useState('');
  const navigate = useNavigate();

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch('http://localhost:3007/register', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(formData),
      });

      const data = await response.json();
      
      if (!response.ok) {
        throw new Error(data.message || 'Registration failed');
      }

      console.log('Registration Successful:', data.message);
      navigate('/login');
    } catch (err) {
      setError(err.message);
      console.error('Registration Error:', err);
    }
  };

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  return (
    <div className="container">
      {/* Header Section */}
      <header className="header">
        <h1 className="logo">Foodokil</h1>
        <h2 className="sub-header">Register</h2>
      </header>

      {/* Main Content */}
      <main className="main-content">
        <div className="description-section">
          <h3>Foodokil.com</h3>
          <p>
            Foodokil is a place where you can please your soul and tummy with 
            delicious food recipes of all cuisine. And our service is absolutely free.
          </p>
        </div>

        {/* Registration Form */}
        <form onSubmit={handleSubmit} className="registration-form">
          <div className="form-group">
            <label>Username:</label>
            <input
              type="text"
              name="username"
              value={formData.username}
              onChange={handleChange}
              required
            />
          </div>
          
          <div className="form-group">
            <label>Email:</label>
            <input
              type="email"
              name="email"
              value={formData.email}
              onChange={handleChange}
              required
            />
          </div>
          
          <div className="form-group">
            <label>Password:</label>
            <input
              type="password"
              name="password"
              value={formData.password}
              onChange={handleChange}
              required
            />
          </div>
          
          {error && <div className="error-message">{error}</div>}
          <button type="submit" className="submit-btn">Register</button>
        </form>
      </main>

      {/* Footer Section */}
      <footer className="footer">
        <div className="footer-section">
          <p>Â© 2021 | All Rights Reserved</p>
        </div>
        
        <div className="footer-section">
          <h4>Contact Us</h4>
          <p>foodokil@gmail.com</p>
          <p>+342-5324-9454</p>
          <p>2393 Street NYC</p>
        </div>

        <div className="footer-section">
          <h4>Socials</h4>
          <p>Facebook</p>
          <p>Twitter</p>
          <p>Instagram</p>
        </div>
      </footer>
    </div>
  );
};

